import React from "react";
import logo from "../Images/egate_logo.jpg";

const Header = () => {
  return (
    <div>
      <div>
        <img src={logo} alt="logo" width={300} />
        <div><Avatar></Avatar></div>
      </div>
    </div>
  );
};

export default Header;
